import Loading from '../Loading/Loading'
import './Profile.css'

function Profile() {
  const users = useFetch('https://127.0.0.1:3000/service/users')

  return (
    <aside id="profile">
      "Hola, "{users.username}
    </aside>
  )
}

export default Profile
